import React from "react";
import { Menu } from "semantic-ui-react";
import { Link } from "react-router-dom";

const menuItemStyle = {
  color: "white",
};

const hoverStyle = {
  color: "lightpurple", // Replace with the actual light purple color code
};

export const Navbar = () => {
  return (
    <Menu inverted secondary>
      <Menu.Item position="left">
        <Menu.Item as={Link} to="/" style={menuItemStyle}>
          Ethan Jordon
        </Menu.Item>
      </Menu.Item>
      <Menu.Item position="right">
        <Menu.Item
          as={Link}
          to="/about"
          style={menuItemStyle}
          onMouseEnter={(e) => (e.currentTarget.style.color = "lightpurple")}
          onMouseLeave={(e) => (e.currentTarget.style.color = "white")}
        >
          About
        </Menu.Item>
        <Menu.Item
          as={Link}
          to="/skills"
          style={menuItemStyle}
          onMouseEnter={(e) => (e.currentTarget.style.color = "lightpurple")}
          onMouseLeave={(e) => (e.currentTarget.style.color = "white")}
        >
          Skills
        </Menu.Item>
        <Menu.Item
          as={Link}
          to="/projects"
          style={menuItemStyle}
          onMouseEnter={(e) => (e.currentTarget.style.color = "lightpurple")}
          onMouseLeave={(e) => (e.currentTarget.style.color = "white")}
        >
          Projects
        </Menu.Item>
        <Menu.Item
          as={Link}
          to="/contact"
          style={menuItemStyle}
          onMouseEnter={(e) => (e.currentTarget.style.color = "lightpurple")}
          onMouseLeave={(e) => (e.currentTarget.style.color = "white")}
        >
          Contact
        </Menu.Item>
        <Menu.Item
          as={Link}
          to="/resume"
          style={menuItemStyle}
          onMouseEnter={(e) => (e.currentTarget.style.color = "lightpurple")}
          onMouseLeave={(e) => (e.currentTarget.style.color = "white")}
        >
          Resume
        </Menu.Item>
      </Menu.Item>
    </Menu>
  );
};
